import React, { useState, useEffect } from "react";
import { Card, CardContent } from "./components/ui/card";
import { Button } from "./components/ui/button";
import { Tabs, TabsList, TabsTrigger, TabsContent } from "./components/ui/tabs";

import type1 from "./data/type1.json";

const types = {
  1: [
  "I strive to be perfect.", 
  "I dislike making mistakes."],
  2: ["I love helping others.", "I want to be needed."],
  3: ["I am focused on success.", "I want to be admired."],
  4: ["I seek deeper meaning.", "I feel deeply and uniquely."],
  5: ["I observe before acting.", "I value knowledge highly."],
  6: ["I prepare for worst-case scenarios.", "I value loyalty."],
  7: ["I seek fun and freedom.", "I dislike feeling trapped."],
  8: ["I am strong-willed and assertive.", "I protect the vulnerable."],
  9: ["I go with the flow.", "I avoid conflict when possible."]
};

const centerMap = {
  1: "Gut", 8: "Gut", 9: "Gut",
  2: "Heart", 3: "Heart", 4: "Heart",
  5: "Head", 6: "Head", 7: "Head"
};

export default function TritypeTest() {
  const [checked, setChecked] = useState({});
  const [results, setResults] = useState(null);
  const [activeTab, setActiveTab] = useState("1");

  useEffect(() => {
    document.querySelectorAll('[data-tab]').forEach(el => {
      el.removeAttribute('data-tab-selected');
    });
    const selectedTab = document.querySelector(`[data-tab='${activeTab}']`);
    if (selectedTab) selectedTab.setAttribute('data-tab-selected', activeTab);
  }, [activeTab]);

  const handleCheck = (type, idx) => {
    const key = `${type}-${idx}`;
    setChecked({ ...checked, [key]: !checked[key] });
  };

  const calculateResults = () => {
    const scores = {};
    const centerScores = { Gut: {}, Heart: {}, Head: {} };

    Object.keys(types).forEach((type) => {
      const items = types[type];
      const checkedCount = items.reduce((acc, _, idx) => acc + (checked[`${type}-${idx}`] ? 1 : 0), 0);
      const quotient = checkedCount / items.length;
      scores[type] = quotient;
      centerScores[centerMap[type]][type] = quotient;
    });

    const tritype = Object.entries(centerScores).map(([center, scoreObj]) => {
      const sorted = Object.entries(scoreObj).sort((a, b) => b[1] - a[1]);
      return sorted[0][0];
    });

    const topType = Object.entries(scores).sort((a, b) => b[1] - a[1])[0][0];
    setResults({ scores, tritype, topType });
  };

  return (
    <div className="min-h-screen flex items-center justify-center px-4 py-8">
      <div className="w-full max-w-4xl bg-white rounded-2xl shadow-xl flex flex-col p-6 space-y-6">
        <h1 className="text-4xl font-bold text-center text-orange-500">Tritype Checklist</h1>

        <Tabs value={activeTab} onValueChange={setActiveTab}>
          <TabsList className="grid grid-cols-3 sm:grid-cols-9 gap-2 mb-4 text-center">
            {Object.keys(types).map((type) => (
              <TabsTrigger key={type} value={type} data-tab={type}>
                Type {type}
              </TabsTrigger>
            ))}
          </TabsList>

          <div className="flex-1 overflow-hidden rounded-xl border bg-orange-50 max-h-[60vh] overflow-y-auto p-4">
            {Object.entries(types).map(([type, statements]) => (
              <TabsContent key={type} value={type}>
                <h2 className="text-lg font-semibold mb-4 text-orange-600">Type {type} Statements</h2>
                <div className="space-y-2">
                  {statements.map((text, idx) => (
                    <label key={idx} className="flex items-start gap-2 text-sm">
                      <input
                        type="checkbox"
                        className="mt-1"
                        checked={checked[`${type}-${idx}`] || false}
                        onChange={() => handleCheck(type, idx)}
                      />
                      <span>{text}</span>
                    </label>
                  ))}
                </div>
              </TabsContent>
            ))}
          </div>
        </Tabs>

        <div className="text-center">
          <Button onClick={calculateResults}>Submit</Button>
        </div>

        {results && (
          <div className="p-4 border rounded shadow bg-orange-100 text-center">
            <h2 className="text-xl font-semibold text-orange-700 mb-2">Results</h2>
            <p><strong>Most Likely Tritype:</strong> {results.tritype.join('')}</p>
            <p><strong>Highest Type Overall:</strong> Type {results.topType}</p>
          </div>
        )}
      </div>
    </div>
  );
}
